import logo from './logo.svg';
import { ReactDOM } from 'react-dom';
import './App.css';

const Hello = () => {
  return (
    <div>
      <p>Hello world</p>
    </div>
  )
}

const App = () => {
  return (
    <div>
      <h1>Greetings</h1>

      <Hello />
    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'))
export default App;
